import React from "react";
import { Link, useNavigate } from 'react-router-dom';
import './Nav.css'



const Nav = () => {
    const navigate = useNavigate()

    const wow = (url) => {
        navigate(url)
    }
    return (
        <div className="main-nav">
            <Link className='links'
                to="/home"
            > Home
            </Link>

            <button onClick={() => navigate('/characters/page/1')}>
                Character
            </button>



            <Link className='links'
                to="/houses/page/1"
            > Houses
            </Link>

        </div>

    )
}

export default Nav;
